function drawDepRegLifa() {
	
	var selection = $('#selected').text();
	if (selection.length == 0){
		alert("pas de sélection");
		return;
	}
	
	var tabSelection = selection.split(','); 
	var count = tabSelection.length; 
	
	if (count == 1){
		draw1(tabSelection[0]);
		return;
	}
	
	if (count == 2){
		draw2(tabSelection[0], tabSelection[1]);
		return;
	}
	draw3(tabSelection[0], tabSelection[1], tabSelection[2]);
}

function draw1(nom) {	
	var dataDep = new google.visualization.DataTable();
	dataDep.addColumn('number', 'Annee');
	dataDep.addColumn('number', nom);
	
	var dataReg = new google.visualization.DataTable();
	dataReg.addColumn('number', 'Annee');
	dataReg.addColumn('number', nom);

	var dataLifa = new google.visualization.DataTable();
	dataLifa.addColumn('number', 'Annee');
	dataLifa.addColumn('number', nom);
	
	// Set données
	for(var i = 0; i < liste_cros.data.length; i++){
		if(liste_cros.data[i].n == nom){
			var rang		= parseInt(liste_cros.data[i].r);
			var annee		= liste_cros.data[i].a  - 2000;
			var championnat	= liste_cros.data[i].ch;

			console.log('data.addRow' + annee + ' ' +  rang);

			if (championnat == 'dep'){
				dataDep.addRow([annee,  rang]);
			}
			else if (championnat == 'reg'){
				dataReg.addRow([annee,  rang]);
			}
			else {
				dataLifa.addRow([annee,  rang]);
			}
		}
	}
	drawData(dataDep, dataReg, dataLifa);
}

function drawData(dataDep, dataReg, dataLifa) {
	var optionsDep = {
		  chart: {
		    title: 'Départementaux',
		  },
		  width: 600,
		  height: 300,
		  legend: {position: 'none'}
	};
	var chartDep = new google.charts.Line(document.getElementById('linechart_materialDep'));
	chartDep.draw(dataDep, google.charts.Line.convertOptions(optionsDep));

	var optionsReg = {
			  chart: {
			    title: 'Régionnaux',
			  },
			  width: 500,
			  height: 300,
			  legend: {position: 'none'}
		};
	var chartReg = new google.charts.Line(document.getElementById('linechart_materialReg'));
	chartReg.draw(dataReg, google.charts.Line.convertOptions(optionsReg));

	var optionsLifa = {
			  chart: {
			    title: 'LIFA',
			  },
			  width: 500,
			  height: 300,
			  legend: {position: 'right'}
		};
	var chartLifa = new google.charts.Line(document.getElementById('linechart_materialLifa'));
	chartLifa.draw(dataLifa, google.charts.Line.convertOptions(optionsLifa));

}

			dataDep.addRow( [a + 10, depRang1[a],  depRang2[a], depRang3[a]]);
		}
		
		if (regRang1[a] > 0 && regRang2[a] > 0 && regRang3[a] > 0){
			dataReg.addRow( [a + 10, regRang1[a],  regRang2[a], regRang3[a]]);
		}
		if (lifaRang1[a] > 0 && lifaRang2[a] > 0 && lifaRang3[a] > 0){
			dataLifa.addRow([a + 10, lifaRang1[a], lifaRang2[a], lifaRang3[a]]);
		}
	}
	drawData(dataDep, dataReg, dataLifa);
}

$(document).ready(function() {
	var table = $('#example').DataTable();
 
	$('#example tbody').on( 'click', 'tr', function () {
		$(this).toggleClass('selected');
	    var rowData = table.rows( { selected: true } ).data()[0];
	    var oldSelection = $('#selected').text(); 
	    var sel = $(this)[0].cells[2].innerHTML;
	    var newSel;
	    // si déjà sélectionné on retire
	    if (oldSelection.indexOf(sel) >= 0){
	    	newSel = oldSelection.replace(sel, '');
	    	$('#selected').text(newSel);
	    }
	    // sinon on ajout
	    else {
	    	if (oldSelection.length == 0){
	    		newSel = sel;
	    	}
	    	else {
	    		newSel = oldSelection + "," + sel;
	    	}
	    }
	    $('#selected').text(newSel);
	} );
 		
		
} );

</script>
